package SortTitle_Class;

import java.util.HashMap;
import java.util.Map;

public class ValidAnagram_242 {
	public static void main(String args[]) {
		//s = "rat", t = "car"

		System.out.println(isAnagramLetter("", ""));
	}
	
	//用字母异位
	public static  boolean isAnagramLetter(String s, String t) {
		//如果字符的长度不相等直接返回
		if(s.length() != t.length()) {
			return false;
		}
		
		int[] nums =new int[26];
		for(int i=0; i<s.length(); i++) {
			nums[s.charAt(i) - 'a']++;
			nums[t.charAt(i) - 'a']--;
		}
		
		for(int i=0; i<nums.length; i++) {
			if(nums[i]!=0) {
				return false;
			}
		}
		return true;
	}
	
	//给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的字母异位词。
	//注意：若 s 和 t 中每个字符出现的次数都相同，则称 s 和 t 互为字母异位词。
	public static  boolean isAnagram(String s, String t) {
        //int value = Integer.valueOf('a');
		//如果字符的长度不相等直接返回
		if(s.length() != t.length()) {
			return false;
		}
		if(s == null && t == null) {
			return true;
		}
		
		char[] schar= s.toCharArray();
		char[] tchar= t.toCharArray();
		Map<Character, Integer> hashmap01= new HashMap<Character, Integer>();
		Map<Character, Integer> hashmap02= new HashMap<Character, Integer>();
		for(int i = 0; i<s.length(); i++) {

			int str = hashmap01.get(schar[i])==null ? 0 : hashmap01.get(schar[i]);
			hashmap01.put(schar[i], str+1);
			str = hashmap02.get(tchar[i])==null ? 0 : hashmap02.get(tchar[i]);
			hashmap02.put(tchar[i], str+1);
		}
		
		if(hashmap01.size() != hashmap02.size()) {
			return false;
		}
		
		for (Map.Entry<Character, Integer> entry : hashmap01.entrySet()) {

			if((int)(entry.getValue()) != (int)(hashmap02.get(entry.getKey()) == null ? 0:hashmap02.get(entry.getKey()))) {
				return false;
			}
		}
		
		return true;
    }
	
	
	//交换
	private static void swap(int[] arr, int i, int j) {
		int t = arr[i];
		arr[i] = arr[j];
		arr[j] = t;
	}
}
